import { gql, useQuery } from '@apollo/client'

const Persons = ({ persons }) => {
    return (
        <div>
            {persons.map((p) => (
                <div key={p.name}>
                    {' '}
                    {p.name} {p.phone}
                </div>
            ))}
        </div>
    )
}

export default Persons
